import axios from "axios";
import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";

export default function AddSsd() {
  let navigate = useNavigate();

  const [ssd, setSsd] = useState({
    brand: "",
    model: "",
    serialNumber: "",
    size: "",
    purchasePrice: "",
    purchaseDate: "",
    saleValue: "",
    arrivalDate: "",
  });

  const [category, setCategory] = useState({
    productCategory: "",
  });

  const {
    brand,
    model,
    serialNumber,
    size,
    purchasePrice,
    purchaseDate,
    saleValue,
    arrivalDate,
  } = ssd;

  const onInputChange = (e) => {
    setSsd({ ...ssd, [e.target.brand]: e.target.value });
  };
  const onsubmit = async (e) => {
    e.preventDefault();
    await axios.post("http://localhost:9090/ssd/post", ssd);
    navigate("/");
  };
}
